import React from 'react';
import AppointmentBanner from './AppointmentBanner';
import AvailableAppointments from './AvailableAppointments';

const Appointments = () => {
    return (
        <div>
           
            <AppointmentBanner/>
            <AvailableAppointments/>
        </div>
    );
};

export default Appointments;
